function Burger({ isOpen }) {
  return (
    <>
      <div className="w-[2rem] h-[2rem]">
        <div className="w-[2rem] h-[0.5rem] bg-black rounded-[10px]"></div>
        <div className="w-[2rem] h-[0.5rem] bg-black rounded-[10px]"></div>
        <div className="w-[2rem] h-[0.5rem] bg-black rounded-[10px]"></div>
      </div>
    </>
  );
}

export default Burger;
